import React from 'react'
import { Image } from 'react-simple-img';

const SpeakerImage = ({id}) => {
    const imageUrl = `/speakers/speaker-${id}.jpg`;
    return (
        <Image
            src={imageUrl}
            animationDuration="1"
            width={200}
            height={200}
            applyAspectRatio="true"
        />
    )
}

export default SpeakerImage;
